pragma solidity =0.6.6;

import './UniswapV2Library.sol';
import './SushiswapV2Library.sol';
import './interfaces/IUniswapV2Router02.sol';
import './interfaces/IUniswapV2Pair.sol';
import './interfaces/IERC20.sol';

contract FlashLoanerDual {
  address immutable unifactory;
  address immutable sushifactory;
  //address sushiaddress = 0xC0AEe478e3658e2610c5F7A4A2E1777cE9e4f2Ac;
  //uint constant deadline = 10 days;

  IUniswapV2Router02 immutable sushiRouter;
  IUniswapV2Router02 immutable uniRouter;
  //IUniswapV2Pair immutable uniPair;

  constructor(address _ufactory, address _sfactory, address _uniRouter, address _sushiRouter) public {
    unifactory = _ufactory; 
    sushifactory = _sfactory;
    sushiRouter = IUniswapV2Router02(_sushiRouter);
    uniRouter = IUniswapV2Router02(_uniRouter); 
  }

  function uniswapV2Call(address _sender, uint _amount0, uint _amount1, bytes calldata _data) external {

    (uint data) = abi.decode(_data, (uint));
    //address factory = data == 0 ? unifactory : sushifactory;

    address token0 = IUniswapV2Pair(msg.sender).token0();
    address token1 = IUniswapV2Pair(msg.sender).token1();
    if(data == 0){
        require(msg.sender == UniswapV2Library.pairFor(unifactory, token0, token1), "Unauthorized From Uniswap");
    } else {
        require(msg.sender == SushiswapV2Library.pairFor(sushifactory, token0, token1), "Unauthorized From Sushiswap"); 
    }

    require(_amount0 == 0 || _amount1 == 0);

    IUniswapV2Router02 router = data == 0 ?  sushiRouter : uniRouter;

    IERC20 token = IERC20(_amount0 == 0 ? token1 : token0);


    { // stack too deep
    uint amountToken = _amount0 == 0 ? _amount1 : _amount0;
    address[] memory path = new address[](2);
    path[0] = _amount0 == 0 ? token0 : token1;
    path[1] = _amount0 == 0 ? token1 : token0;

    token.approve(address(router), amountToken);

    // no need for require() check, if amount required is not sent sushiRouter will revert
    uint amountRequired = data == 0? UniswapV2Library.getAmountsIn(unifactory, amountToken, path)[0] : SushiswapV2Library.getAmountsIn(sushifactory, amountToken, path)[0]; 

    path[0] = _amount0 == 0 ? token1 : token0;
    path[1] = _amount0 == 0 ? token0 : token1;
    uint amountReturned = IUniswapV2Router02(router).swapTokensForExactTokens(amountRequired, amountToken, path, address(msg.sender), uint(-1))[0];

    require(amountToken > amountReturned, "No Profit");

    // YEAHH PROFIT
    token.transfer(_sender, amountToken - amountReturned);
    }
  }

  function getdata1(address _sender, uint _amount0, uint _amount1, bytes calldata _data) external pure returns (uint re) {

    (uint data) = abi.decode(_data, (uint));
    re = data;

  }

  function getdata2(address _sender, uint _amount0, uint _amount1, bytes calldata _data) external pure returns (uint re) {

    re = abi.decode(_data, (uint));

  }

  function getaddresses(address _sender, uint _amount0, uint _amount1, bytes calldata _data) 
  external 
  view
  returns (address uf,address sr, address s)
  {

      (uint data) = abi.decode(_data, (uint));
      uf = data == 0 ? unifactory : sushifactory;
      address factory = uf;
      IUniswapV2Router02 router = data == 0 ?  sushiRouter : uniRouter;
      sr = address(router);

      address[] memory path = new address[](2);

      uint amountToken = _amount0 == 0 ? _amount1 : _amount0;

      address token0 = IUniswapV2Pair(msg.sender).token0();
      address token1 = IUniswapV2Pair(msg.sender).token1();
      if(factory == unifactory){
        require(msg.sender == UniswapV2Library.pairFor(factory, token0, token1), "Unauthorized From Uniswap");
      } else {
        require(msg.sender == SushiswapV2Library.pairFor(factory, token0, token1), "Unauthorized From Sushiswap"); 
      }
      s = msg.sender; 

  }

}
